import React from 'react';

import classes from './button.module.css';

const button = (props) => (
    <button 
        className = {[classes.Button, classes[props.buttonType]].join(" ")}
        // onClick   = {props.clicked}
    >
        {props.children}
    </button>
);

export default button;
